import React from "react";
import "./WeatherDisplay.css";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import Typography from "@mui/material/Typography";
import { CardActionArea } from "@mui/material";

export default function WeatherDisplay({ weatherData }) {
    return (
        <div className="weather-display">
            <Card sx={{ maxWidth: 345, minWidth: 310 }}>
                <CardActionArea>
                    <CardMedia
                        component="img"
                        height="140"
                        image={
                            weatherData.weather === "Clouds"
                                ? "https://www.shutterstock.com/image-photo/dark-sky-heavy-clouds-converging-600nw-2220607227.jpg"
                                : weatherData.weather === "Clear"
                                ? "https://img.freepik.com/free-photo/sun-flare_74190-1494.jpg?size=626&ext=jpg&ga=GA1.1.1546980028.1703808000&semt=ais"
                                : weatherData.weather === "Rain"
                                ? "data:image/jpeg;base64,"
                                : weatherData.weather === "Snow"
                                ? "data:image/jpeg;base64,"
                                : weatherData.weather === "Thunderstorm"
                                ? "https://s7d2.scene7.com/is/image/TWCNews/lightning_jpg-8"
                                : weatherData.weather === "Drizzle"
                                ? "data:image/jpeg;base64,"
                                : weatherData.weather === "Mist"
                                ? "data:image/jpeg;base64,"
                                : weatherData.weather === "Smoke"
                                ? "data:image/jpeg;base64,"
                                : weatherData.weather === "Haze"
                                ? "data:image/jpeg;base64,"
                                : weatherData.weather === "Dust"
                                ? "https://s.w-x.co/util/image/w/in-duststorm%20%281%29.jpg?v=at&w=1280&h=720"
                                : weatherData.weather === "Fog"
                                ? "https://brightpunjabexpress.com/wp-content/uploads/2020/11/foggy-weather.png"
                                : weatherData.weather === "Sand"
                                ? "https://cdn.telanganatoday.com/wp-content/uploads/2022/03/Kuwait-Sand-storm-3-scaled.jpg"
                                : "data:image/jpeg;base64,"
                        }
                        alt="image"
                    />
                    <CardContent>
                        <Typography gutterBottom variant="h5" component="div">
                            <b>{weatherData.city}</b>
                        </Typography>
                        <Typography
                            variant="body2"
                            color="text.secondary"
                            component="span"
                        >
                            <b>
                                <p>Temprature : {weatherData.temp}&deg;C</p>
                                <p>
                                    Minimum Temprature : {weatherData.tempMin}
                                    &deg;C
                                </p>
                                <p>
                                    Maximum Temperature : {weatherData.tempMax}
                                    &deg;C
                                </p>
                                <p>Humidity : {weatherData.humidity}%</p>
                                <p>Windspeed : {weatherData.windSpeed} km/h</p>
                                <p>
                                    Feels like : {weatherData.feelsLike}&deg;C
                                </p>
                                <p>Weather : {weatherData.weather}</p>
                            </b>
                        </Typography>
                    </CardContent>
                </CardActionArea>
            </Card>
        </div>
    );
}
